  g /= 255; 
  b /= 255; 
  let cmin = Math.min(r,g,b), 
      cmax = Math.max(r,g,b), 
      delta = cmax - cmin, 
      h = 0, 
      s = 0, 
      l = 0; 
  if (delta == 0) 
    h = 0; 
  else if (cmax == r) 
    h = ((g - b) / delta) % 6; 
  else if (cmax == g) 
    h = (b - r) / delta + 2; 
  else 
    h = (r - g) / delta + 4; 
